import Datas from '../data/data';

export default function Slider() {
    return (
        <main className='home-gallery'>
            {Datas.map(data => {
                return (
                    <div key={data.id}>
                        <img>{data.cover}></img>
                        <h2>{data.title}</h2>

                    </div>
                )
            })}
        </main>
    )
}
